        backgroundUrl={process.env.PUBLIC_URL + '/images/19.png'}
      />

      <ProfileCard
        imageUrl={process.env.PUBLIC_URL + '/images/avatar/11.png'}
        name={'Heran'}
        profileId={'@herachadi'}
        accountType={'Free'}
        backgroundUrl={process.env.PUBLIC_URL + '/images/18.png'}
      /> */}
    </div>
  );
}

export default Suggestions;
